Definition:
Any value from a discrete managed list, used to specify the general state of a resource if known., in the form:
&lt;ResourceStatuskeyword&gt;
  &lt;valueListUrn&gt;valueListUrn&lt;/valueListURN&gt;
  &lt;value&gt;value&lt;/value&gt;
&lt;/ResourceStatuskeyword&gt;
where the content of valueListUrn is the Uniform Resource Name of a published list of values and definitions, and the content of value is a string denoting the value itself .  Multiple instances MAY occur.

Any value from a discrete managed list, used to specify a resource, in the form:
&lt;resourcekeyword&gt;
  &lt;valueListUrn&gt;valueListUrn&lt;/valueListURN&gt;
  &lt;value&gt;value&lt;/value&gt;
&lt;/resourcekeyword&gt;
where the content of valueListUrn is the Uniform Resource Name of a published list of values and definitions, and the content of value is a string denoting the value itself.
